import {CloseBtn, Carta, Imagen, Data, ContBtn} from './styled-components'
export default function Card({name, species, gender, image, onClose}) {
   

   return (
      <Carta>
         
         <Data>
            <h2>{name}</h2>
         </Data>
         
         <Imagen src={image} alt={name} />

         <Data>
            <h2>{gender}</h2>
            <hr/>
            <h2>{species}</h2>
         </Data>
      </Carta>
     
   );
}
